  return (
    <div className="app-container">
      <header className="header">
        <h1>VectorShift Pipeline Builder</h1>
        <PipelineToolbar />
      </header>
      <div className="pipeline-ui">
        <PipelineUI />
        <SubmitButton />
      </div>
    </div>
  );
}

export default App;
